import React from "react";
import Textfield from "../Textfield/Textfield";
import Todowrapper from "../Todowrapper/Todowrapper";
import "./Box.css";

export default () => {
  return (
    <div className="box">
      <Todowrapper />
      <button
        style={{
          display: "block",
          height: "50px",
          width: "50px",
          borderRadius: "50%",
        }}
      />
      <Textfield />
    </div>
  );
};
